import React, { Component, Fragment } from "react";
import "./App.css";

class App extends Component {
  render() {
    return (
      <Fragment>
        <h1>Hello from react</h1>
        <h2>Goodbye</h2>
      </Fragment>
    );
  }
}

export default App;
